import { Dialog, DialogTitle, IconButton, useTheme } from "@mui/material";

function SubscribePopup ({username, nickname, type, open, setOpen}){

    const theme = useTheme();

    return(
    <div>
        <Dialog
        open={open}
        onClose={() => setOpen(false)}
        >
            <DialogTitle fontWeight="bold" color={theme.palette.primary.dark}>
                Abbonati a {username}
            </DialogTitle>
            <IconButton onClick={() => setOpen(false)}>
                Chiudi
            </IconButton>
        </Dialog>
    </div>
    )
}

export default SubscribePopup;
